</shmem> Guest Setup Add IVSHMEM support Download and Install Scream Drivers . To make the driver use IVSHMEM , run from an elevated shell: REG ADD HKLM\SYSTEM\CurrentControlSet\Services\Scream\Options /v UseIVSHMEM /t REG_DWORD /d 2. Note: If your box's sound doesn't work and the scream-ivshmem unit is running, check the note in end of the Scream + Bridged Network . You should now be able to hear the guest's audio on your host.

