My current keyboard is a Motospeed CK61. It has a pretty good quality, but a terrible usability. It has a confusing layer system, which kills any possibility of using the arrow keys, some miscellaneous keys (home, end, page up, etc...), or F1-F12 keys quickly. Also, it doesn't have the tilde (yes, you've read that right, there is not way to make a beautiful ~ by pressing a key). I mostly use KMonad to fix these keyboard quirks, this is a relevant part of my current configuration: (defsrc esc 1 2 3 4 5 6 7 8 9 0 - = bspc tab q w e r t y u i o p [ ] \ caps a s d f g h j k l ; ' ret lsft z x c v b n m , . / rsft lctl lmet lalt spc ralt cmp rctl
) (deflayer base grv _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ esc _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ lmet lctl _ _ lalt rctl @ext
) (deflayer extra _ f1 f2 f3 f4 f5 f6 f7 f8 f9 f10 f11 f12 _ _ _ up _ _ _ _ _ _ _ _ ssrq @pau _ _ left down rght _ _ _ _ ins home pgup pgdn _ _ _ _ _ _ _ _ _ del end _ @mat _ _ _ _ _ _ @bas
) You can see how I use it to create a new layer to make arrows and others usable, turn right-alt into left-alt (ralt does not behave correctly when using the us(intl) layout), change ctrl keys position, turn caps lock into esc and add the tilde (grv) in place of the original esc.
